INSERT INTO `products` (`id`, `category_id`, `sku`, `name`, `description`, `picture_name`, `price`, `current_discount`, `stock`, `product_unit`, `is_available`, `add_date`) VALUES
(1, 2, 'SB750372', 'KELAPA MUDA', '\r\nKelapa muda adalah buah muda dari pohon kelapa dengan kulit hijau, daging lembut, dan air kelapa segar. Rasanya manis, tinggi air, dan kaya nutrisi seperti elektrolit, vitamin, mineral, serta serat. Cocok sebagai minuman penyegar dan bahan tambahan dalam hidangan. Digunakan juga dalam kosmetik karena sifat pelembap alaminya.', 'eac819781c2499354cade3d90e3469e7.jpg', 5000, '0.00', '7000.00', 'Biji', 1, '2020-03-26 15:02:52'),
(2, 2, 'BS350420', 'KELAPA MUDA WULUNG', '\r\nKelapa hijau wulung pink adalah varian unik kelapa wulung dengan kulit hijau dan sentuhan pink. Kaya akan elektrolit, vitamin, mineral, dan serat. Manfaatnya termasuk menjaga hidrasi, tekanan darah, kekebalan tubuh, pencernaan, dan kulit. Rasanya manis dan menyegarkan. Pilihan sehat yang lezat.', '7a9bc45a022ef70f8ee15bc42aa8c069.jpg', 12000, '0.00', '50.00', 'Biji', 1, '2020-03-26 15:03:40'),
(4, 2, 'TS120790', 'KRAMBIL', '\r\nKelapa tua, kulit cokelat, daging keras, sedikit air kelapa. Kaya lemak sehat, serat, vitamin, mineral, antioksidan. Manfaat: jantung sehat, kekebalan tubuh, pencernaan, energi. Minyak kelapa bagus untuk kulit dan rambut. Digunakan dalam hidangan penutup, kue, gurih. Sumber nutrisi yang bergizi dan bermanfaat bagi kesehatan.', 'b92785eb493a6ff6aaffa413d8cef9c5.jpg', 4000, '0.00', '100.00', 'Biji', 1, '2020-03-26 19:36:30'),
(5, 2, 'WS120811', 'KELAPA MUDA ISI', 'Kelapa isi adalah daging kelapa yang lembut dan lebih tebal. Manfaatnya meliputi energi, serat, vitamin, mineral, dan antioksidan. Mendukung kesehatan jantung. Cocok untuk makanan penutup, minuman, atau hidangan gurih. Keseimbangan cita rasa lezat dan nilai gizi yang baik.', '91be0201c7259d915af1dd82b01fccd3.jpg', 5000, '0.00', '700.00', 'Biji', 1, '2020-03-26 19:36:51'),
(8, 2, 'PS220885', 'KELAPA GADING', '\r\nKelapa gading adalah varietas kelapa dengan kulit putih gading. Dagingnya putih, lembut, rasanya manis. Kaya elektrolit, vitamin, mineral, serat. Air kelapanya menyegarkan dan menjaga hidrasi. Cocok untuk hidangan, minuman, dan makanan penutup. Pilihan sehat dan menyegarkan dengan keunikan warna dan kandungan gizi yang baik.', 'd11c3ef4ed61b8b12bb843d04ff54775.jpg', 6000, '0.00', '50.00', 'Biji', NULL, '2020-03-26 19:38:05'),
(9, 9, 'AB450163', 'GULA AREN', '\r\nGula aren, pemanis alami dari nira pohon aren. Cokelat tua, aroma karamel. Rasa manis lembut, nuansa gula kelapa. Kandungan zat besi, kalsium, fosfor, dan vitamin B. Indeks glikemik rendah, cocok untuk pengaturan gula darah. Pilihan pemanis alami yang sehat dan populer.', '82d22722e6969527b96217fef885c29d.jpg', 27500, '0.00', '100.00', '/10Kg', 1, '2020-03-26 19:42:43'),
(15, 9, 'GMG250713', 'GULA MERAH', '\r\nGula merah adalah pemanis alami dari tebu atau kelapa yang direbus dan mengental. Rasanya manis dengan aroma karamel. Sumber energi instan, mengandung mineral seperti kalsium, zat besi, dan potasium. Perlu konsumsi yang wajar karena berdampak pada kadar gula darah.', '550baa710e17666880e8163ad574d6d2.jpg', 24000, '0.00', '50.00', '/10 Kg', 1, '2023-05-13 23:51:53');

